import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function Login() {
  return (
    <div className='col-xs-6 col-sm-6 col-md-6 offset-xs-3 offset-sm-3 offset-md-3 login-form'>
        <h2>Login</h2>
        <Card style={{ width: '100%' }}>
      <Card.Body>
        <Card.Text>
      <Form.Label htmlFor="inputPassword4">Password</Form.Label>
      <Form.Control size="lg" type="email" name="emaillogin" placeholder="User Email" />
      <Form.Label htmlFor="inputPassword4">Password</Form.Label>
      <Form.Control type="password" id="inputPassword4" aria-describedby="passwordHelpBlock" placeholder="Password" size="lg"/>
      <Form.Text id="passwordHelpBlock" muted>
        Your password must be 8-20 characters long, contain letters and numbers,
        and must not contain spaces, special characters.
      </Form.Text>
     </Card.Text>
     <Button variant="primary" size="lg">
          Login
        </Button>
      </Card.Body>
    </Card>      
    </div>
  );
}

export default Login;
